import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { useAuth } from "../context/AuthContext";

const FIELDS_OF_INTEREST = [
  "Agriculture, Food, Nutrition",
  "Animal Related",
  "Arts, Culture, Humanities",
  "Civil Rights, Social Action, Advocacy",
  "Community Improvement, Capacity Building",
  "Crime, Legal Related",
  "Disease, Disorders, Medical Disciplines",
  "Educational Institutions",
  "Employment, Job Related",
  "Environmental Quality Protection, Beautification",
  "Health - General & Rehabilitative",
  "Housing, Shelter",
  "Human Services",
  "International Foreign Affairs and National Security",
  "Medical Research",
  "Mental Health and Crisis Intervention",
  "Mutual/Membership Benefit Organizations",
  "Philanthropy, Voluntarism and Grantmaking",
  "Public Safety, Disaster Relief & Preparedness",
  "Public, Society Benefit",
  "Recreation, Sports, Leisure, Athletics",
  "Religion, Spiritual Development",
  "Science and Technology Research Institutes",
  "Social Science Research Institutes",
  "Youth Development",
];

const US_STATES = [
  "Alabama",
  "Alaska",
  "Arizona",
  "Arkansas",
  "California",
  "Colorado",
  "Connecticut",
  "Delaware",
  "Florida",
  "Georgia",
  "Hawaii",
  "Idaho",
  "Illinois",
  "Indiana",
  "Iowa",
  "Kansas",
  "Kentucky",
  "Louisiana",
  "Maine",
  "Maryland",
  "Massachusetts",
  "Michigan",
  "Minnesota",
  "Mississippi",
  "Missouri",
  "Montana",
  "Nebraska",
  "Nevada",
  "New Hampshire",
  "New Jersey",
  "New Mexico",
  "New York",
  "North Carolina",
  "North Dakota",
  "Ohio",
  "Oklahoma",
  "Oregon",
  "Pennsylvania",
  "Rhode Island",
  "South Carolina",
  "South Dakota",
  "Tennessee",
  "Texas",
  "Utah",
  "Vermont",
  "Virginia",
  "Washington",
  "West Virginia",
  "Wisconsin",
  "Wyoming",
];

const CITIES_BY_STATE = {
  California: [
    "Los Angeles",
    "San Francisco",
    "San Diego",
    "San Jose",
    "Sacramento",
  ],
  "New York": ["New York City", "Buffalo", "Rochester", "Syracuse", "Albany"],
  Texas: ["Houston", "Austin", "Dallas", "San Antonio", "Fort Worth"],
  // ... 可以继续添加其他州的城市
};

export default function ProfileDetailsPage() {
  const navigate = useNavigate();
  const { user } = useAuth();
  const [error, setError] = useState("");
  const [formData, setFormData] = useState({
    orgName: "",
    location: "",
    homepage: "",
    coreValues: "",
    fieldOfInterest: "",
    partnershipGoal: "",
    resourcesProvided: "",
  });

  const [selectedState, setSelectedState] = useState("");
  const [availableCities, setAvailableCities] = useState([]);

  useEffect(() => {
    const orgType = localStorage.getItem("orgType");
    if (!orgType) {
      navigate("/profile-setup/type");
    }
  }, [navigate]);

  useEffect(() => {
    if (selectedState && CITIES_BY_STATE[selectedState]) {
      setAvailableCities(CITIES_BY_STATE[selectedState]);
    } else {
      setAvailableCities([]);
    }
    setFormData((prev) => ({
      ...prev,
      location: selectedState ? `${selectedState} - ` : "",
    }));
  }, [selectedState]);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError("");

    try {
      const response = await fetch("http://localhost:3001/api/profile", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${localStorage.getItem("token")}`,
        },
        body: JSON.stringify({
          ...formData,
          orgType: localStorage.getItem("orgType"),
          coreValues: formData.coreValues.split(",").map((v) => v.trim()),
        }),
      });

      if (!response.ok) {
        throw new Error("Failed to save profile");
      }

      navigate("/home");
    } catch (err) {
      setError(err.message);
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name === "state") {
      setSelectedState(value);
    } else if (name === "city") {
      setFormData((prev) => ({
        ...prev,
        location: `${selectedState} - ${value}`,
      }));
    } else {
      setFormData((prev) => ({
        ...prev,
        [name]: value,
      }));
    }
  };

  return (
    <div className="min-h-screen flex items-center justify-center px-4 sm:px-6 lg:px-8">
      <div className="max-w-lg w-full space-y-8">
        <div>
          <h2 className="mt-6 text-center text-3xl font-bold text-gray-900">
            Organization Details
          </h2>
          <p className="mt-2 text-center text-sm text-gray-600">
            Help us understand your organization better
          </p>
        </div>

        {error && <div className="mt-4 text-red-600">{error}</div>}

        <form onSubmit={handleSubmit} className="mt-8 space-y-6">
          <div>
            <label
              htmlFor="orgName"
              className="block text-sm font-medium text-gray-700"
            >
              Organization Name
            </label>
            <input
              type="text"
              name="orgName"
              id="orgName"
              required
              className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-gray-500 focus:ring-gray-500"
              value={formData.orgName}
              onChange={handleChange}
            />
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700">
              Location
            </label>
            <div className="mt-1 grid grid-cols-2 gap-4">
              <div>
                <select
                  name="state"
                  value={selectedState}
                  onChange={handleChange}
                  required
                  className="block w-full rounded-md border-gray-300 shadow-sm focus:border-gray-500 focus:ring-gray-500"
                >
                  <option value="">Select State</option>
                  {US_STATES.map((state) => (
                    <option key={state} value={state}>
                      {state}
                    </option>
                  ))}
                </select>
              </div>
              <div>
                <select
                  name="city"
                  onChange={handleChange}
                  required
                  disabled={!selectedState}
                  className="block w-full rounded-md border-gray-300 shadow-sm focus:border-gray-500 focus:ring-gray-500"
                >
                  <option value="">Select City</option>
                  {availableCities.map((city) => (
                    <option key={city} value={city}>
                      {city}
                    </option>
                  ))}
                </select>
              </div>
            </div>
          </div>

          <div>
            <label
              htmlFor="homepage"
              className="block text-sm font-medium text-gray-700"
            >
              Organization Homepage
            </label>
            <input
              type="url"
              name="homepage"
              id="homepage"
              required
              placeholder="https://www.example.com"
              className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-gray-500 focus:ring-gray-500"
              value={formData.homepage}
              onChange={handleChange}
            />
          </div>

          <div>
            <label
              htmlFor="coreValues"
              className="block text-sm font-medium text-gray-700"
            >
              Top 3 Core Values (comma-separated)
            </label>
            <input
              type="text"
              name="coreValues"
              id="coreValues"
              required
              placeholder="Sustainability, Innovation, Community"
              className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-gray-500 focus:ring-gray-500"
              value={formData.coreValues}
              onChange={handleChange}
            />
          </div>

          <div>
            <label
              htmlFor="fieldOfInterest"
              className="block text-sm font-medium text-gray-700"
            >
              Field of Interest
            </label>
            <select
              name="fieldOfInterest"
              id="fieldOfInterest"
              required
              className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-gray-500 focus:ring-gray-500"
              value={formData.fieldOfInterest}
              onChange={handleChange}
            >
              <option value="">Select a field</option>
              {FIELDS_OF_INTEREST.map((field) => (
                <option key={field} value={field}>
                  {field}
                </option>
              ))}
            </select>
          </div>

          <div>
            <label
              htmlFor="partnershipGoal"
              className="block text-sm font-medium text-gray-700"
            >
              Co-Marketing Partnership Goal
            </label>
            <textarea
              name="partnershipGoal"
              id="partnershipGoal"
              required
              rows={3}
              className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-gray-500 focus:ring-gray-500"
              value={formData.partnershipGoal}
              onChange={handleChange}
              placeholder="What do you hope to achieve through partnerships?"
            />
          </div>

          <div>
            <label
              htmlFor="resourcesProvided"
              className="block text-sm font-medium text-gray-700"
            >
              Resources Provided
            </label>
            <textarea
              name="resourcesProvided"
              id="resourcesProvided"
              required
              rows={3}
              className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-gray-500 focus:ring-gray-500"
              value={formData.resourcesProvided}
              onChange={handleChange}
              placeholder="What resources can you offer to potential partners?"
            />
          </div>

          <div>
            <button
              type="submit"
              className="w-full flex justify-center py-2 px-4 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-gray-800 hover:bg-gray-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-gray-500"
            >
              Complete Profile
            </button>
          </div>
        </form>
      </div>
    </div>
  );
}
